import React from "react";
import { BrowserRouter as Router, Routes, Route, Link } from "react-router-dom";
import Home from "./pages/home";

const Header = () => (
  <header className="bg-white text-black  text-center flex justify-between items-center py-8 px-14">
    <div>
      <img src="/logo.png" alt="logo" className=" " />
    </div>
    <nav>
      <ul className="flex justify-center gap-6 font-medium ">
        <li><Link to="/">Home</Link></li>
        <li><Link to="/about">About Us</Link></li>
        <li><Link to="/contact">Services</Link></li>
        <li><Link to="/about">Pricing</Link></li>
        <li><Link to="/contact">Help Center</Link></li>
        <li><Link to="/contact">Contact</Link></li>
      </ul>
    </nav>
    <div className=" flex gap-4 ">
      <button className=" bg-white hover:bg-blue-600 text-blue-500 hover:text-white font-medium border border-blue-500 px-6 py-1.5 rounded-full">Login</button>
      <button className=" bg-white hover:bg-blue-600 text-blue-500 hover:text-white font-medium border border-blue-500 px-6 py-1.5 rounded-full">Signup</button>
      <img src="/header/translate.png" alt="translate" className=" object-contain " /> 
    </div>
  </header>
);

const Footer = () => (
  <footer className="bg-gray-800 text-white p-4 text-center">
    &copy; {new Date().getFullYear()} My Website
  </footer>
);

// const Home = () => <div className="p-6 text-center">üè† Welcome to the Home Page</div>;
// const About = () => <div className="p-6 text-center">üìñ Learn more About Us</div>;
// const Contact = () => <div className="p-6 text-center">üìû Get in Touch</div>;

export default function App() {
  return (
    <Router>
      <div className="flex flex-col min-h-screen bg-[#f1f0f0ec]">
        <Header />
        <main className="flex-grow p-6">
          <Routes>
            <Route path="/" element={<Home />} />

          </Routes>
        </main>
        <Footer />
      </div>
    </Router>
  );
}
